@KomornickiLeon i:
Strengthening ties to China means strengthening Russia’s hand in Europe. 
This weakens the West’s collective ability to push back against Beijing’s and Moscow’s systematic assault on democratic principles.

@DrewPavlou If you're against two countries befriending each other, you're against humanity.

China and Germany can choose to do things most beneficial to their people.

Who are you? Why should countries be dictated by you?
